	(70, 'Rajasthan', 'Jaipur Tehsil', 'Jaipur', 'hawa mahal', 26.92393200, 75.82686520, 'The Hawa Mahal is a palace in the city of Jaipur, Rajasthan, India. Built from red and pink sandstone, it is on the edge of the City Palace, Jaipur, and extends to the Zenana, or women\'s chambers. Hawa Mahal, also known as the "palace of winds" was built in 1799 by Maharaja Sawai Pratap Singh. It is considered unique as it has many small windows and balconies that seem like a honeycomb. The structure was built in 1799 by the Maharaja Sawai Pratap Singh, grandson of Maharaja Sawai Jai Singh, the founder of the city of Jaipur of Rajasthan. He was so inspired by the unique structure of Khetri Mahal that he built this grand and historical palace. It was designed by Lal Chand Ustad. Its five-floor exterior is akin to a honeycomb with its 953 small windows called Jharokhas decorated with intricate latticework. The original intent of the lattice design was to allow royal ladies to observe everyday life and festivals celebrated in the street below without being seen.', '[0.02579393668611249,0.07899232922704634,-0.20485532426116781,-0.04629634210352005,-0.014257336140884102,-0.020364257488714472,-0.009596588046591947,0.028475966301746817,0.03954490958836279,-0.035000518934011175,-0.05125937554178356,0.009344081176926764,0.049969919207353795,-0.013378865094318753,-0.021639393830535692,-0.0329731529804634,0.026756774189130958,0.026730801202537267,-0.008312159709566917,0.011413614108709494,-0.06662508561056554,0.011861085377741177,-0.019804407777688434,0.006613491886357171,0.07076766347231823,0.02573111771853735,0.010376498644030596,-0.03281724606093685,-0.025958740601046734,-0.011862745876884089,-0.016095532692074217,-0.0018157645627686876,-0.05689818063123843,0.0074013941796707994,0.04458653498606,-0.019475321947550514,0.024748692225629483,-0.011912494851205485,0.08168136783906287,-0.017371232033604835,0.0647724165668456,-0.06270490763401816,-0.019761397799888614,-0.009540389075599802,0.07