	(76, 'Rajasthan', 'Jaipur Tehsil', 'Jaipur', 'jaipur', 26.91545760, 75.81898170, 'Jaipur is the capital and the largest city of the north-western Indian state of Rajasthan. As of 2011, the city had a population of 3.1 million, making it the tenth most populous city in the country. Located 268 km from the national capital New Delhi, Jaipur is also known as the Pink City due to the dominant color scheme of its buildings in the old city. Jaipur was founded in 1727 by Sawai Jai Singh II, the Kachhwaha Rajput ruler of Amer, after whom the city is named. It is one of the earliest planned cities of modern India, designed by Vidyadhar Bhattacharya. During the British colonial period, the city served as the capital of Jaipur State. After Indian independence in 1947, Jaipur became the capital of the newly formed state of Rajasthan in 1949. Jaipur is a popular tourist destination in India, forming a part of the Western Golden Triangle tourist circuit along with Delhi and Agra.', '[-0.022094123451142565,0.01430845170171216,-0.17595857173674315,-0.012019500069373861,0.03421067650492734,0.03635122416110295,0.004229586820624749,0.018820170977019525,0.0614415681309791,-0.00967785444549951,-0.04121728337949464,-0.029748770221618787,0.09793475926927868,-0.05818810465356503,0.03433820448444322,-0.06638503933693654,-0.04805383828137646,-0.0032906780714364943,0.016894805286280422,0.03263118675863209,-0.06247710596464636,0.049689806018599965,0.015657219485067014,-0.05134895775209956,0.10494170314379185,-0.019145202924811436,0.03759660396106445,-0.014084438737694131,0.017670099161749234,-0.032110544842259926,0.03317282167163225,-0.027224195627127308,-0.02579071585737927,0.010150635369559314,0.019476749871556873,-0.033252207658880914,-0.04058744348066236,0.004388611095081556,0.06337349982066355,-0.005719956081234939,0.05752648575983723,-0.02491513199801949,-0.02267104935847413,-0.037519813973398805,0.07409197409901402,0.011826247100415023,0.017452701196668672,-0.0019810766817905568,0.0703